import React from 'react'

export default function Home() {
  return (
    <div>
      <h1>Home</h1>
      <h2>Price list</h2>
      <h2>For developers</h2>
      <h2>Contact</h2>
      <button>Login</button>
      <button>Register</button>
    </div>
  )
}
